docReady(function(){slidecontainer=document.querySelector(".slides"),pckry=new Packery(slidecontainer,{rowHeight:130,columnWidth:1e3});for(var e=pckry.getItemElements(),n=0,r=e.length;r>n;n++){var t=e[n],i=new Draggabilly(t,{handle:".handle"});pckry.bindDraggabillyEvents(i)}eventie.bind(slidecontainer,"click",function(e){classie.has(e.target,".slide")&&(pckry.remove(e.target),pckry.layout())})});